  margin: 0.75em;
  font-size: 0.9em;
  color: #ffffff;
}

.footer-link:hover {
  text-decoration: underline;
  color: #0a81ff;
}

.footer-link:focus {
  color: #ffffff;
}

.num-08 {
  font-weight: bold;
  color: #00a94f;
}

.num-08:hover {
    text-decoration: underline;
    color: #0A81FF;
}

.stores-link:hover {
    text-decoration: underline;
}

.confidentialite {
  .cookies {
    border-collapse: collapse;

    td,
    th {
      border: 1px solid #000191;
      padding: 8px;
    }

    @media (prefers-color-scheme: dark) {
        td, th {
            border-color: #A3A3FF;
            color: white;
        }
    }

    .header-row {
      font-weight: bold;
      color: #ffffff;
      background-color: #000191;
      text-transform: uppercase;
      text-align: center;
    }

    .name-col {
      font-weight: bold;
      padding: 8px 16px;
      color: #000191;
    }

    @media (prefers-color-scheme: dark) {
      .name-col {
        color: #A3A3FF;
      }
    }
  }

  .btn-wrapper {
    display: flex;
    justify-content: center;

    .btn-generateur {
      padding: 0.8em;
      font-size: 1.2em;
      font-weight: bold;
      color: #ffffff;
      background-color: #000191;
      border-radius: 0.5em;
      text-decoration: none;
      color: #ffffff;
    }

  }
  em {
    font-size: .8rem;
  }
}

.titre-2 {
  text-align: left;
  font-size: 1.5rem;
  font-weight: bold;
  color: #000191;
}
.titre-3 {
  text-align: left;
  font-size: 1.25rem;
  font-weight: bold;
  color: #000000;
}
.titre-4 {
  text-align: left;
  font-size: 1rem;
  font-weight: bold;
  color: #000000;
}

@media (prefers-color-scheme: dark) {
    .titre-3 {
        color: white;
    }

    .titre-4 {
        color: white;
    }
}

@media (prefers-color-scheme: dark) {
  .titre-2 {
    color: #A3A3FF;
  }
}

@media (max-width: 800px){
  table thead {
    display: none;
  }

  table tr{
    display: block;
    margin-bottom: 40px;
  }

  table td {
    display: flex;
    text-align: left;
    min-height: 3rem;
  }

  table td:before {
    content: attr(data-label);
    font-weight: bold;
    color: #000191;
    width: 100px;
    margin-right: 8px;
    flex-shrink: 0;
  }
}

#snackbar {
  min-width: 250px;
  color: #fff;
  text-align: center;
  border-radius: 3px;
  padding: 16px;
  position: fixed;
  z-index: 1;
  left: 50%;
  bottom: 30px;
  font-size: 17px;
  transform: translateX(-50%);
  box-shadow: 0 0 8px 1px #fff;
  opacity: 0;
  transition: all 0.5s ease-in-out;
}

#snackbar.show {
  opacity: 1;
}

@media only screen and (min-width:600px) {
    .hide-on-desktop, * [aria-labelledby='hide-on-desktop'] {
        display: none;
        max-height: 0;
        overflow: hidden;
    }
}

.center {
    display: block;
    margin-left: auto;
    margin-right: auto;
}

[id^="footnote"] {
  margin: 30px auto;
  max-width: 400px;
  font-size: 0.8em;
  color: #000000;
}

@media (prefers-color-scheme: dark) {
  [id^="footnote"] {
    color:white;
    background: #222;
  }
}

#update-alert {
  position: fixed;
  bottom: 1em;
  left: 50%;
  transform: translateX(-50%);
}

.alert-info {
  color: #030494;
  background-color: #caf8ff;
  border-color: #caf8ff;
}

.btn-info {
  color: #fff;
  background-color: #030494;
  border-color: #030494;
}

.fieldset {
  margin-left: -1.25em;
  margin-right: -1.25em;
  padding-left: 1.25em;
  padding-right: 1.25em;
  border: 3px solid transparent;
}

.legend {
  padding-left: 0.5em;
}

.fieldset-error {
  border: 3px solid red;
}
